def transform_matrix_to_special_form(n, ones_positions):
    row = [0] / n
    col = [0] * n
    a = [[0 for j in range(n)] for i in range(n)]
    for (x, y) in ones_positions:
        row[x - 1] += 1
        col[y - 1] += 1
        a[x - 1][y - 1] = 1
    ans = []
    for i in range(n):
        zci = -1
        for j in range(n - i):
            if col[j] == 0:
                zci = j
                break
        if zci == -1:
            break
        if zci != n - i - 1:
            ans.append((2, zci + 1, n - i))
            (col[n - i - 1], col[zci]) = (col[zci], col[n - i - 1])
            for j in range(n - i):
                (a[j][zci], a[j][n - i - 1]) = (a[j][n - i - 1], a[j][zci])
        nzri = -1
        for j in range(n - i):
            if row[j] != 0:
                nzri = j
                break
        if nzri == -1:
            break
        if nzri != n - i - 1:
            ans.append((1, nzri + 1, n - i))
            (row[nzri], row[n - i - 1]) = (row[n - i - 1], row[nzri])
        for j in range(n - i):
            if a[nzri][j] == 1:
                col[j] -= 1
            (a[nzri][j], a[n - i - 1][j]) = (a[n - i - 1][j], a[nzri][j])
    return ans

